INSERT INTO MetadatoImagen VALUES (41,9,'Henry Loaiza Ceballos,  fue condenado a 30 años de prisión por su responsabilidad en el homicidio de Daniel Arcila Cardona, principal testigo de la ‘Masacre de Trujillo’, y un amigo de éste. Esta fue la primera sentencia emitida en dos décadas relacionada con la muerte sistemática de unas 342 personas, en hechos ocurridos entre 1986 y 1994. Luego, un juez especializado de Bogotá condenó a 44 años de cárcel al mayor (r) Alirio Antonio Urueña por su responsabilidad en la masacre, pero es prófugo de la justicia.La investigación probó que el entonces comandante del Batallón Palacé de Buga, de la Tercera Brigada del Ejército, se alió con los paramilitares financiados por los narcotraficantes Henry Loaiza alias ‘El Alacrán’, Iván Urdinola Grajales y Diego Montoya alias ‘Don Diego’, para cometer al menos 103 de los 342 crímenes registrados.El caso de la masacre de Trujillo se había caracterizado por la impunidad y todo tipo de tropiezos en el proceso judicial.');
