INSERT INTO MetadatoImagen VALUES (43,9,'El 18 de febrero de 2002, dos años después de los hechos centrales de la masacre, cerca de 300 personas, la mayoría de ellos desplazados que vivían en Cartagena, retornaron. Volver al pueblo y recuperarlo se inscribe en la memoria colectiva de los retornados como un gesto heroico, sin que eso implique que sea un recuerdo libre de dolor y rabia. Fotos de la Comisión Colombiana de Juristas, 2002.');
