INSERT INTO MetadatoImagen VALUES (46,9,'En medio de la fragilidad de las condiciones de retorno debido a la militarización y la confrontación armada, surgió en 2003 la Asociación de Mujeres Unidas de El Salado, hoy en día conformada por veintidós mujeres. La Asociación se levantó sobre el tradicional liderazgo comunitario que han tenido las mujeres de esa zona. Sin embargo, hoy han logrado una mayor presencia en el espacio público y una participación política más visible. La Asociación consolidó una iniciativa económica colectiva de ganadería en un terreno de diez hectáreas que les fue adjudicado en 2010. En 2005 propusieron recuperar las fiestas patronales para que la memoria de la violencia vivida no acabara con sus tradiciones. Foto de 2009.');
