DROP DATABASE repositorionuevo;
CREATE DATABASE repositorionuevo;
USE repositorionuevo ;

CREATE TABLE  Imagenes (
	Id	INTEGER PRIMARY KEY AUTO_INCREMENT,
	Nombre	VARCHAR(300) NOT NULL,
	Direccion	VARCHAR(200) NOT NULL,
	Fuente	VARCHAR(800),
	NivelViolencia	INTEGER
);
CREATE TABLE IF NOT EXISTS Configuraciones (
	IdConfiguracion	INTEGER NOT NULL,
	Nombre	VARCHAR(200),
	Valor	VARCHAR(200),
	PRIMARY KEY(IdConfiguracion)
);
CREATE TABLE IF NOT EXISTS TiempoRecorrido (
	Id	INTEGER PRIMARY KEY AUTO_INCREMENT,
	IdRecorrido	INTEGER,
	Tiempo	INTEGER
);
CREATE TABLE IF NOT EXISTS RespuestaPregunta (
	IdPregunta	INTEGER NOT NULL,
	IdRecorrido	INTEGER NOT NULL,
	Respuesta	INTEGER,
	PRIMARY KEY(IdPregunta,IdRecorrido)
);
CREATE TABLE IF NOT EXISTS PreguntaTest (
	IdPregunta	INTEGER NOT NULL PRIMARY KEY AUTO_INCREMENT,
	Pregunta	VARCHAR(200) NOT NULL
);
CREATE TABLE IF NOT EXISTS ImagenRecorrido (
	IdImagen	INTEGER NOT NULL,
	IdRecorrido	INTEGER NOT NULL,
	Calificacion	INTEGER,
	PRIMARY KEY(IdImagen,IdRecorrido)
);
CREATE TABLE IF NOT EXISTS Recorrido (
	Id	INTEGER PRIMARY KEY AUTO_INCREMENT,
	FechaRecorrido	VARCHAR(100) NOT NULL,
	IdUsuario	INTEGER NOT NULL
);
CREATE TABLE IF NOT EXISTS Usuario (
	Id	INTEGER NOT NULL PRIMARY KEY AUTO_INCREMENT,
	Usuario	VARCHAR(50) NOT NULL UNIQUE,
	Contrasena	VARCHAR(100) NOT NULL,
	Edad	INTEGER NOT NULL,
	Nombre	VARCHAR(200) NOT NULL
);

CREATE TABLE IF NOT EXISTS Tipo (
	Tipo	VARCHAR(50),
	PRIMARY KEY(Tipo)
);

CREATE TABLE IF NOT EXISTS Metadato (
	Id	INTEGER PRIMARY KEY AUTO_INCREMENT,
	Nombre	VARCHAR(50) NOT NULL,
	Tipo	VARCHAR(50) NOT NULL,
	FOREIGN KEY(Tipo) REFERENCES Tipo(Tipo)
);

CREATE TABLE IF NOT EXISTS MetadatoImagen (
	IdImagen	INTEGER NOT NULL,
	IdMetadato	INTEGER NOT NULL,
	Valor	VARCHAR(1000),
	FOREIGN KEY(IdImagen) REFERENCES Imagenes(Id),
	PRIMARY KEY(IdImagen,IdMetadato),
	FOREIGN KEY(IdMetadato) REFERENCES Metadato(Id)
);



COMMIT;
